import { getUrl } from "../apis/api";



const RedirectPage =  () => {

    var pathtext= window.location.pathname ;
    if(pathtext.length!==0){
        pathtext = pathtext.substring(1);
    }

    getUrl(pathtext);

    window.location.href = 'https://google.com';
    return null;

    return getUrl(pathtext);

    // return (
    //     <h5> Redirecting to {pathtext} </h5>
    // );

}

export default RedirectPage;
